import React, { useState } from "react";
import css from "../../main.module.css";
import { SignOut } from "./SignOut";

export const Setting = () => {
  const [value, setValue] = useState("");

  const renderContent = () => {
    if (value === "2") {
      return <p>lala</p>;
    } else {
      return (
        <div>
          <div className={css.signOut}>
            <SignOut id="signOut" />
          </div>
        </div>
      );
    }
  };
  return <>renderContent</>;
};
